def lengthOfLongestSubstring(s):
    print(f'字符串s的长度为:{len(s)}')
    list =[]
    lenlist = [1]
    num =1
    if len(s) != 0:
        for e in s:
            list.append(e)
            print(f"第{num}次的list为：{list}")

            if len(list) != len(set(list)):
                lenlist.append(len(list)-1)
                list.reverse()
                while len(list) != len(set(list)):
                    list.pop()
                list.reverse()
                print(f"第{num}次的pop后为：{list}")
            num = num + 1
            lenlist.append(len(list))
        maxlen = max(lenlist)
        print(f"长度数组：{lenlist}")
        print(f"最长子串长度为：{max(1, maxlen)}")
        return max(1, maxlen)
    else:
        print("字符串为空，最长子串长度为：0")
        return 0


